const RunningOut = () => {
	let products = [
          {
          	title:"solo leveling",
          	url:"product-2.jpg",
          }
	]
	return (
		<>


			<div className="page2">
              <div className="txts">

              </div>
              <div className="images">
                      {products.map((product)=>{
                      	return(
                             <img src={`images/${product.url}`} alt=""/>
                      	)
                      })}

              </div>



           </div>



           </>




	)
}

export default RunningOut
